0e1ce81f-3da5-48e7-aabe-8c4b5920b80a	Апокалипсис	Исторический боевик «Апокалипсис» стал второй полнометражной картиной знаменитого Мэла Гибсона, который решил познакомить широкую аудиторию с вымершей цивилизацией Майя. \r\n\r\nФильм рассказывает о юном индейце по имени Лапа Ягуара, проживающем в джунглях, где расположилась его небольшая деревушка. Однажды в размеренный и спокойный мир гармонии с близкими и природой врываются кровожадные захватчики из более развитого и многочисленного племени. На глазах юноши перерезают горло его отцу, а его самого и его друзей уводят в кандалах в большой каменный город. Там пленников ждет неминуемая смерть от рук жреца, отрубающего головы в качестве жертвоприношения неведомым богам. Но Лапа Ягуара не собирается мириться с такой трагической участью:  ему удается совершить дерзкий побег.\r\n\r\nЕсли вам интересно узнать, как сложится судьба главного героя, рекомендуем смотреть онлайн «Апокалипсис».	6af421d3-3eed-47f9-b27c-c1052652a81c	\\img\\content\\films\\1928432405.jpg	https://www.youtube.com/embed/EXzDLzZVaV0	2006	t
19751ea9-c4bb-4ab3-b7c4-c11ccc52364f	Главный герой	Неигровой персонаж компьютерной игры выходит из-под контроля и меняет мир. Комедийный блокбастер года – зрелищное и веселое погружение в виртуальную реальность в компании Райана Рейнольдса, исполнившего одну из самых обаятельных ролей в своей карьере. Эксцентричного злодея сыграл Тайка Вайтити, а режиссерское кресло занял Шон Леви («Живая сталь», «Ночь в музее», «Очень странные дела»).\r\n\r\n<p> В жизни безымянного Парня всё просто: один и тот же кофе по утрам, неизменная голубая рубаха и заготовленные фразы на любой случай. Целый день он проводит на работе в банке, а тем временем за окном разворачиваются фантастические баталии с перестрелками, взрывами, погонями. Но это не его дело. Все приключения достаются людям в черных очках, от которых Парень предпочитает держаться подальше. Вот только однажды он с первого взгляда влюбляется в одну из них. Ради девушки мечты Парень тоже надевает черные очки. Ему открывается шокирующая правда: весь его мир – это компьютерная симуляция, где он просто один из элементов фона. А разве может глубоко второстепенный персонаж претендовать на главную роль в чьей-то чужой игре? Поверьте, этот Парень может. </p>\r\n\r\nЭнергичную и воодушевляющую фантастическую комедию «Главный герой» можно посмотреть в нашем онлайн-кинотеатре.	6af421d3-3eed-47f9-b27c-c1052652a81c	\\img\\content\\films\\1658316876.jpg	https://www.youtube.com/embed/wnS4A5-vtFA	2021	f
282b4524-8328-41bd-b233-fcf5c681b5fb	Удовольствие	Амбициозная девушка из глубинки Швеции приезжает в Лос-Анджелес, чтобы стать актрисой. Порноактрисой. Но ее представления об этой индустрии сильно отличаются от реальности, а цена успеха может оказаться слишком высокой. Откровенный взгляд за кадр фильмов для взрослых – дерзкий и впечатляющий полнометражный дебют шведки Ниньи Тюберг на основе ее одноименной короткометражки 2013 года, получившей награду на Каннском кинофестивале.\r\n\r\n<p> Линнея, не так давно достигшая совершеннолетия, задалась целью покорить американскую порноиндустрию под псевдонимом Белла Черри. Она искренне верит, что у нее есть для этого всё необходимое: смелость, сексуальность, стремление к успеху. Но оказывается, этого недостаточно. Юность и внешняя привлекательность сами по себе никого не сделают звездой: конкуренция здесь напряженная, продюсеры пресыщены, а положение молоденьких актрис шаткое. Мягко говоря. Открывая изнанку этой специфичной фабрики грез, Белла также узнает много нового и о самой себе. Действительно ли она готова на всё – и перед камерами, и за кулисами съемок? </p>\r\n\r\nЦенителям актуального и реалистичного европейского кино предлагаем посмотреть онлайн фильм «Удовольствие».	84838fa8-1a77-4efb-ab30-8b8e5533508c	\\img\\content\\films\\1575931286.jpg	https://www.youtube.com/embed/Q-HqTKX88N8	2021	t
32742d3c-e121-4041-b168-bb2ac3b0e8da	Любовницы	Три девушки, обманутые своими женатыми ухажерами, решают отомстить за себя, а после – за всех жертв мужского коварства. Героини создают тайное агентство любовниц-мстительниц. Паулина Андреева, Александра Бортич и Юлия Александрова встают на тропу войны с мужчинами-обманщиками в комедии о наболевшем «Любовницы». По другую сторону баррикад оказались герои Гоши Куценко, Максима Лагашкина, Юрия Стоянова и многих других.\r\n\r\n<p>Студентка юридического факультета Ира, начинающая актриса Алиса и миловидная медсестра Маша стали жертвами несчастной любви. Их обидчики – профессор, режиссер и пластический хирург соответственно – лицемерно использовали их, чтобы развеяться от семейной жизни. Горе объединяет, и обманутые девушки устраивают пьяные поминки по загубленной любви в баре. На смену слезам закономерно приходит жажда мести. Новые подруги разрабатывают план, как поквитаться со своими бывшими ухажерами. Но еще остаются тысячи и тысячи мужчин, обманывающих сразу двух и более женщин, – своих жен и любовниц. Героини решают создать общество покинутых мстительниц и наказать как можно больше женатых ловеласов. Главное – обойтись без крови и каждый раз подходить к делу «креативно».</p>\r\n\r\n<p>Приглашаем посмотреть комедию «Любовницы» в нашем онлайн-кинотеатре.</p>	26f2f911-f5e0-4bfa-86f6-df380dcbc62a	\\img\\content\\films\\967427004.jpg	https://www.youtube.com/embed/V9B5nFi0nfI	2019	t
36cf95db-78a6-42cc-9c8a-50fb15e7bb9f	Круэлла	Предыстория экстравагантной и коварной Круэллы Де Виль из диснеевской классики «101 далматинец». В 1970-х молодая Эстелла, которой только предстоит стать злодейкой, начинает покорять мир британской моды. Она знакомится с баронессой фон Хельман, главой престижного модного дома, и эта встреча становится началом восхождения Круэллы – тёмной стороны личности Эстеллы, которая была с ней с самого детства. \r\n<p>Юная Эстелла Миллер – творческая девочка с хорошим вкусом, которая интересуется модой и мечтает стать дизайнером одежды. У Эстеллы есть тёмная сторона – её жестокая и скандальная версия, которую мама девочки шутливо называет Круэллой. Однажды проблемы в школе вынуждают Кэтрин с дочерью переехать в Лондон, но по дороге женщина погибает в результате несчастного случая, и Эстелла остаётся сиротой. </p>\r\n<p>Через десять лет выросшая Эстелла, которой всё же удалось добраться до столицы, работает уборщицей в модном универмаге. Она продолжает заниматься дизайном одежды, и однажды судьба сводит девушку с её кумиром – знаменитой баронессой фон Хельман. Это знакомство позволяет Эстелле приблизиться к своей мечте о карьере дизайнера, но вскоре героиня понимает, что фон Хельман хранит множество тёмных секретов. Когда дружба двух талантливых женщин превращается во вражду, на помощь Эстелле приходит её альтер-эго – дерзкая и смелая Круэлла, которая готова на всё, чтобы добиться своего и победить. </p>\r\n<p>Приглашаем поклонников стильных и остроумных историй посмотреть онлайн фильм «Круэлла», где главную роль исполнила великолепная Эмма Стоун. </p>	6af421d3-3eed-47f9-b27c-c1052652a81c	\\img\\content\\films\\1473949030.jpg	https://www.youtube.com/embed/9F2-eR2dfMY	2021	f
409d12f3-89f0-4d8b-8bab-ddc9e7f349b1	Лед	Музыкальная сказка с Аглаей Тарасовой, Александром Петровым и Марией Ароновой в главных ролях. \r\n\r\nИркутск, начало двухтысячных. Надя Лапшина мечтает стать фигуристкой, но местная влиятельная тренерша отвергает девочку – не та хореография, нет координации… Мама, не желая расстраивать дочку, дарит ей старую советскую книжку о фигурном катании и водит тренироваться на замерзший Байкал. Оставшись сиротой, Надя едва не забывает о мечте, но случайно встречает ту самую тренершу и добивается ее внимания.\r\n\r\nНадя становится лучшей из лучших и получает шанс уехать в Москву, где ее выбирает в партнерши красавчик-фигурист. Но мир фигурного катания жесток, и, получив травму, Надя в одночасье лишается всего и уезжает к точке отсчета – в родной Иркутск. Здесь она встречает разбитного хоккеиста Горина, который хочет помочь ей встать с инвалидной коляски.\r\n\r\n«Лед» – это нечто новое для русского кино. Мюзикл, но с современными песнями, мелодрама – но изобретательная. Смотреть онлайн фильм «Лед» можно на нашем сайте.	26f2f911-f5e0-4bfa-86f6-df380dcbc62a	\\img\\content\\films\\868984390.jpg	https://www.youtube.com/embed/63vkDyLi98A	2018	f
4313e000-e4da-4b1b-a8cb-245b0ada7db2	Простая просьба	Молодая мама и овдовевшая домохозяйка Стефани восхищается своей успешной и волевой красавицей-подругой Эмили. Но когда Эмили загадочно исчезает, выясняется, как далека была ее жизнь от идеала. Фильм с двойным дном на стыке триллера, детектива и комедии «Простая просьба» основан на романе современной американской писательницы Дарси Белл. Экранизацию снял режиссер Пол Фиг («Девичник в Вегасе», «Шпион», «Копы в юбках»). В один из самых запоминающихся женских кинодуэтов 2018 года объединились Анна Кендрик («Мне бы в небо», «Идеальный голос», «Жизнь прекрасна») и Блейк Лайвли («Сплетница», «Век Адалин», «Отмель»).\r\n\r\nЭнергичная молодая мама Стефани в одиночестве воспитывает сына после гибели мужа, активно участвует в родительских собраниях и ведет видеоблог для простых домохозяек. У всех соседок-мамочек неугомонная и приторная Стефани вызывает раздражение, но появляется исключение – великолепная Эмили. Она эффектная, уверенная в себе и острая на язык деловая женщина,  живет в роскошном доме вместе с красивым мужем-писателем. Стефани знакомится с Эмили благодаря их сыновьям и уже через несколько дней называет ее близкой подругой. По просьбе Эмили она соглашается присмотреть за ее сыном, не подозревая, что отсутствие подруги затянется надолго. Слишком надолго. Расследуя ее исчезновение, Стефани понимает, что связалась с женщиной-«невидимкой», хранящей темные секреты.\r\n\r\nИроничный и стильный триллер «Простая просьба» можно посмотреть в нашем онлайн-кинотеатре.	554d5b18-e76c-412c-acaa-22306e3a2438	\\img\\content\\films\\1944000566.jpg	https://www.youtube.com/embed/yfXxR_UCLHE	2018	t
