1f337f84-3b6f-4a7c-9142-a09640ad4edb	Альдабра. Путешествие к таинственному острову	Захватывающий семейный фильм о коралловом острове Альдабра – нетронутом волшебном мире в водах Индийского океана. Просмотр фильма перенесет вас в храм природы, куда практически невозможно попасть человеку, но где бьет ключом своя собственная, неведанная и прекрасная жизнь.\r\n\r\nАтолл Альдабра был включен в список Всемирного наследия ЮНЕСКО как уникальный памятник природы. Этот коралловый край практически не затронула цивилизация, и посещение заповедного уголка находится под очень строгим контролем. Шесть раз остров уходил под воду и снова появлялся на поверхности.\r\n\r\nФильм чеха Стива Лихтага расскажет о дикой флоре и фауне Альдабры. Гигантские черепахи, опасные акулы, наземные крабы, кокосовые раки, водные птицы, морские окуни… Это и многое другое засняли кинематографисты, чтобы запечатлеть таинственную Альдабру в вечности. У каждого животного в ленте есть своя музыкальная тема: композитор Роберт Йиша потратил на сочинение музыки около четырех лет. Саундтрек записывал симфонический оркестр из 90 человек.\r\n\r\nСвою историю поведает зрителям и капитан судна, который на 88 дней был захвачен в плен сомалийскими пиратами у берегов Альдабры.\r\n\r\nСмотреть онлайн этот фильм и погрузиться в дикую природу кораллового атолла можно уже сейчас на нашем сайте.	e5cd407d-cae0-4f01-ab7b-d3e625dd954c	\\img\\content\\films\\1529819039.jpg	https://www.youtube.com/embed/LQSYa3e8jUQ	2015	t
