63f2bd2a-6f6f-45b8-8425-0cb20aa15a4b	Послезавтра	В фильме «Послезавтра» режиссер Роланд Эммерих не в первый раз завораживает зрителя апокалиптическими сценами мировых катастроф. Нагнетать атмосферу страха автор «Дня независимости» и «Годзиллы» умеет мастерски. Это становится его излюбленной темой: позднее он вновь обращается к ней, снимая «2012». Благодаря потрясающим спецэффектам визуальный ряд фильма «Послезавтра» получился очень ярким и зрелищным. Масштабность разрушений впечатляет: мощнейшие торнадо в Лос-Анджелесе, затопление Нью-Йорка, стремительное распространение жуткого холода. Наступления нового ледникового периода в результате нарушения озонового слоя Земли по сюжету фильма происходит не через несколько десятилетий, как это предсказывают ученые, а буквально послезавтра. От антарктического ледника откололся кусок невероятных размеров. Вскоре небо над США затягивается тучами, начинается затяжной ливень, переходящий в снежную бурю. Всех, кого еще можно спасти, эвакуируют в Мексику. В Нью-Йорке сын ученого-климатолога вместе со своими друзьями попадает в смертельную ледяную ловушку. Отец отправляется в спасательную экспедицию по заснеженной пустыне – тому, что осталось от северных штатов США.\r\n\r\nУдастся ли выжить героям фильма? Об этом вы узнаете, если решите смотреть онлайн захватывающий фильм-катастрофу «Послезавтра».	6af421d3-3eed-47f9-b27c-c1052652a81c	\\img\\content\\films\\443443206.jpg	https://www.youtube.com/embed/IN79kI4VlNk	2004	f
3cff8d7b-51be-4883-9473-9d5dbe92ea9c	Сбой в матрице	Загадка о происхождении нашего мира всегда волновала людей. Ответить на этот вопрос пытаются и все религии, и труды знаменитых философов, и, конечно же, ученые из разных областей науки.\r\n<p>Однако ничто ещё не вызывало столько споров, как теория, ставящая под сомнение всю реальность происходящего – гипотеза симуляции. Согласно её положениям, весь окружающий нас мир, события и мы сами – лишь результат работы огромного компьютера, функционирующего по заданным алгоритмам. Как и в любой системе, в данной симуляции неизбежны ошибки, благодаря которым есть возможность осознать её наличие. </p>\r\n<p>Хотя основы этой теории были высказаны ещё древнегреческими философами, отправной точкой отсчёта стала лекция американского писателя-фантаста Филипа Киндреда Дика в 1977 году о запрограммированности нашего мира. </p>\r\n<p>Огромный вклад в разработку гипотезы сделал шведский философ Ник Бостром, предложивший три тезиса, доказывающие вероятность этого суждения. </p>\r\n<p>Однако большинству людей гипотеза о симуляции стала известна благодаря культовому научно-фантастическому фильму «Матрица», породившая целую культуру восприятия окружающего мира. </p>\r\n<p>Если вы хотите узнать больше об этой невероятной гипотезе, приглашаем посмотреть онлайн документальный фильм «Сбой в матрице» на нашем сайте. </p>	6af421d3-3eed-47f9-b27c-c1052652a81c	\\img\\content\\films\\163065965.jpg	https://www.youtube.com/embed/iE_I2v98bOw	2021	f
650d5dfd-10dd-4816-9dc1-c347fd0c7744	Чернобыль	После аварии на Чернобыльской АЭС молодой пожарный Алексей присоединяется к группе ликвидаторов, направленных на устранение последствий катастрофы. Они должны предотвратить новый мощный взрыв. Масштабный фильм-катастрофа, вдохновленный реальными событиями, – вторая картина в режиссерской карьере Данилы Козловского, также исполнившего главную роль. \r\n\r\n<p> Апрель 1986 года. Капитан Алексей Карпушин прощается со своей бригадой пожарных в Припяти, чтобы начать новую жизнь в другом городе. Его долгожданный перевод совпадает с трагедией мирового масштаба, беспрецедентной катастрофой ХХ века – взрывом на Чернобыльской атомной электростанции. Но зона отчуждения могла бы стать неизмеримо больше, если бы прогремел еще один взрыв. В экстренных условиях принимается непростое решение: отправить добровольцев в опаснейшее место под реактором, наполненное горячей водой. Ее нужно откачать во избежание нового радиоактивного выброса, способного накрыть Киев, Москву, Европу... Алексей не из тех, кто рвется на рискованную миссию. У него большие планы на будущее, любимая девушка, маленький сын. Он не подходит на роль народного героя, но тем не менее присоединяется к молодому инженеру Валерке и военному водолазу Борису, чтобы спуститься в самое пекло. </p>\r\nСмотрите онлайн фильм Данилы Козловского «Чернобыль» на IVI.	26f2f911-f5e0-4bfa-86f6-df380dcbc62a	\\img\\content\\films\\1754825651.jpg	https://www.youtube.com/embed/qtY2sel76qo	2021	t
