a74485f1-60c5-450c-9a99-98161112995c	Роковой маршрут	Во время похода в заповедный лес молодая пара Алекс и Дженн сбиваются с пути. Они пытаются выжить в диких условиях и спастись от преследования свирепого медведя. Приключенческий фильм ужасов «Роковой маршрут» режиссера и сценариста Адама МакДональда основан на реальной истории 2005 года о столкновении молодого канадца с медведем-людоедом. В напряженную и жестокую схватку с дикой природой вступили герои Мисси Перегрим и Джеффа Рупа.\r\n\r\nМолодая влюбленная пара Алекс и Дженн решают провести выходные в большом и живописном заповеднике. Их поход не задается с самого начала: тропа, которую они выбрали перед выездом, оказывается закрыта. Неоправданно самоуверенный Алекс, презирающий карты и меры безопасности, ведет Дженн по новому маршруту. Где-то в чаще леса он признается, что сбился с пути. Влюбленные едва не ссорятся, но у них возникают и более серьезные проблемы – следы присутствия голодного медведя. Оставшись без еды и без средств связи, герои пытаются вернуться домой и победить зверя, который по праву считает себя хозяином леса.\r\n\r\nПриглашаем посмотреть фильм «Роковой маршрут» в нашем онлайн-кинотеатре.	554d5b18-e76c-412c-acaa-22306e3a2438	\\img\\content\\films\\1833497340.jpg	https://www.youtube.com/embed/gBTpAVL08jY	2014	t
7c7377f6-e7a3-4a49-a1fe-7649f61ca7e0	Семейный бюджет	Ипотека превращает тихую и спокойную жизнь семьи Фроловых в авантюрный квест на грани экстрима. Народная комедия от авторов «Я худею» и «Горько!» – ироничное и остроумное пособие по ведению семейного бюджета и экономии. Со злободневными финансовыми трудностями, задевающими за живое, столкнулись герои Юлии Александровой и Антона Филипенко.\r\n\r\n<p> Фроловы – небогатая, но дружная и веселая семья из Краснодара с двумя детьми школьного возраста. Когда отец семейства получает повышение на работе, он решается сделать себе и домочадцам долгожданный подарок – купить новую квартиру. Правда, пока только в ипотеку, но они уже переезжают из своего ветхого дома в современные апартаменты. А вскоре у папы начинаются проблемы на работе. Платить взносы нечем, но придется. Как сэкономить, где подзаработать? Скромные коллекторы ломятся в двери, однако Фроловы проявляют чудеса изобретательности и смекалки. На что они только не готовы ради ипотеки, которая вдохновляет и на подвиги, и на экстрим... </p>\r\n\r\nИскрометную и обаятельную комедию о насущном «Семейный бюджет» можно посмотреть в нашем онлайн-кинотеатре.	26f2f911-f5e0-4bfa-86f6-df380dcbc62a	\\img\\content\\films\\1630176466.jpg	https://www.youtube.com/embed/zr-5khGNNa8	2021	t
a867fe8f-17e7-46bc-89f6-f995c59c4ff9	Мстители: Война бесконечности	Один из самых ожидаемых и амбициозных фильмов 2018 года. Железный человек, Доктор Стрэндж, Человек-паук, Черная Пантера, Стражи Галактики – за приключениями этих и многих других супергероев Marvel зрители могли наблюдать последние десять лет. Теперь все эти герои соберутся на одном экране, чтобы сразиться с общим врагом, одержимым одной-единственной идеей – восстановить баланс во Вселенной, истребив половину ее обитателей. \r\nДва Камня бесконечности уже превратили Таноса в сильнейшее существо во Вселенной. Он продолжает захватывать планеты и уничтожать тех, кто на них обитает, но главная его цель – добраться до остальных четырех Камней бесконечности. Эти артефакты возникли на заре Вселенной, и каждый из них отвечает за свой аспект бытия – пространство, реальность, силу, душу, разум и время. Если Таносу удастся заполучить их все, он сможет выжигать миры одним щелчком пальцев, а значит, Мстители и их союзники должны сделать все, чтобы его остановить.\r\nФантастический боевик «Мстители: Война бесконечности» вы можете посмотреть онлайн на нашем сайте.	6af421d3-3eed-47f9-b27c-c1052652a81c	\\img\\content\\films\\462112982.jpg	https://www.youtube.com/embed/UsnDPok1ZOU	2018	t
68e0c58e-4e86-4a68-9d49-05474c08c861	Мстители: Финал	Команда Мстителей в последний раз противостоит самому могущественному злодею во Вселенной Таносу. Ради победы им придется объединить силы и выложить, наконец, все припрятанные козыри. Эпохальный блокбастер братьев-режиссеров Руссо «Мстители: Финал» завершает историю о подвигах старой гвардии супергероев в исполнении Роберта Дауни-младшего, Криса Эванса, Скарлетт Йоханссон и других. Легендарная команда одержала свою последнюю фантастическую победу, побив рекорды кассовых сборов за всю историю кино. \r\n\r\n<p>Мир опустел после триумфа Таноса. Команда Мстителей практически развалилась. Одни исчезли с лица земли, другие – потеряли самых близких, а третьи – начали новую жизнь, пытаясь сбежать от воспоминаний. Но этот побег был заведомо обречен: спустя пять лет после катастрофы Тони Старк, Капитан Америка, Соколиный глаз, Черная вдова, Халк и Тор воссоединяются, чтобы всё исправить и  взять судьбу мира в свои надежные руки.</p>\r\n\r\nПриглашаем посмотреть главный супергеройский фильм 2019 года «Мстители: Финал» в нашем онлайн-кинотеатре.	6af421d3-3eed-47f9-b27c-c1052652a81c	\\img\\content\\films\\1790160611.jpg	https://www.youtube.com/embed/gbcVZgO4n4E	2019	t
a9e9308f-b808-4ba4-84f5-3a0a368b3ccd	Девятаев	История подвига советского летчика Михаила Девятаева, попавшего в немецкий плен. 8 февраля 1945 года Девятаев возглавляет побег из концлагеря на острове Узедом, захватив вражеский бомбардировщик. Павел Прилучный в остросюжетном и зрелищном военном блокбастере, вдохновленном реальными событиями, от режиссеров Тимура Бекмамбетова и Сергея Трофимова.\r\n\r\n<p> Молодой летчик-истребитель Михаил Девятаев сражался с первых дней войны. В июле 1944-го он терпит крушение во время воздушного боя, оказавшись на занятой немцами территории. Так начинается страшная, напряженная и невероятная история его плена. После первой неудачной попытки побега Девятаев попадает на остров Узедом в Балтийском море. Но прежде он неожиданно встречает своего боевого товарища Николая Ларина, который пошел на сделку с врагом. Немцы как раз проводят испытания новейших баллистических ракет «Фау-2», в которых видят грозное «оружие возмездия». У Девятаева есть выбор – погибнуть в лагере, больше никогда не поднявшись в небо, или же последовать примеру Ларина, ведь клеймо «предатель Родины» ему и так почти обеспечено. Однако Девятаев идет по третьему пути. Вместе с небольшой группой соратников он захватывает немецкий самолет «Хейнкель», чтобы любой ценой вернуться домой и доставить крайне важные сведения. </p>	26f2f911-f5e0-4bfa-86f6-df380dcbc62a	\\img\\content\\films\\1295613805.jpg	https://www.youtube.com/embed/risii8g1MzI	2021	f
aa6f19a8-9478-4df1-95a9-6618a3e51019	Сумерки	Экранизация одноименного бестселлера Стефани Майер «Сумерки» влюбила в себя миллионы зрителей, актеры, исполняющие главные роли в одночасье проснулись знаменитыми, а тема вампиров, которая только-только затихла после выхода «Интервью с вампиром», снова стала актуальной. Этот фильм превратился в культовый и стал родоначальником одноименной франшизы и не одной пародии, что только свидетельствует о его популярности. \r\n\r\nМолодая девушка Белла переезжает к отцу и приходит в новую школу. Там она встречает загадочного и прекрасного Эдварда из семьи Калленов, которые считаются школьной элитой и не общаются ни с кем, кроме своих. Эдвард влюбляется в Беллу, а она в него, но что-то мешает их безоблачному счастью. Эдвард хранит секрет, узнав который Белла приходит в ужас. Оказывается, Эдвард и вся семья Калленов – вампиры, ужасные смертоносные монстры. Но в отличие от своих собратьев они научились жить в мире с людьми, питаясь кровью животных. Сможет ли Белла преодолеть свой страх и предубеждения? Ведь в нее влюблен еще и совершенно нормальный парень Джейкоб, который отнюдь не намерен уступать красавицу Беллу какому-то кровопийце. Как разрешится любовный конфликт, можно смотреть онлайн в мелодраме «Сумерки».	6af421d3-3eed-47f9-b27c-c1052652a81c	\\img\\content\\films\\509511029.jpg	https://www.youtube.com/embed/xloy7UEhDSw	2008	t
31775ecd-8142-4eed-bb5e-c083d59927c5	Паранормальная тюрьма	Действие напряжённого хоррора разворачивается в городе Бойс, штат Айдахо. Именно здесь расположена одна из самых старых тюрем, о которой ходят жуткие легенды.\r\n<p>По рассказам местных жителей, именно в этой тюрьме содержались самые жестокие преступники штата. Среди них была Мэри Бетт Флейк – единственная женщина-серийный убийца в истории Айдахо. Загадочная преступница до сих пор напоминает о себе: всё, что с ней связано, отмечено четырьмя розами. Так, во дворе тюрьмы цветёт розовый куст, который никогда не увядает. </p>\r\n<p>Загадочная тюрьма давно привлекала смелых и авантюрных исследователей, однако никому не удавалось сохранить хоть малейшее свидетельство, снятое или записанное внутри помещений. </p>\r\n<p>Когда же правительство штата приняло решение о сносе исправительного учреждения, чтобы построить новый квартал, группа разоблачителей паранормальных явлений решило воспользоваться шансом провести собственное расследование. Глава съёмочной группы и ведущий не слишком популярной программы Мэттью – скептик, который хочет узнать, что скрывается за городскими легендами. В этом ему помогает молодая учёная-физик Сара, сконструировавшая собственный прибор для обнаружения духов. </p>\r\n<p>Что удастся выяснить героям в этом пугающем месте, и с какими явлениями им придётся столкнуться? </p>\r\n <p>Об этом можно узнать, посмотрев онлайн хоррор «Паранормальная тюрьма» на нашем сайте. </p>	6af421d3-3eed-47f9-b27c-c1052652a81c	\\img\\content\\films\\476735250.jpg	https://www.youtube.com/embed/EjF3zNtKQJQ	2021	t
aad768ec-74d5-42cf-b8c3-a581c9cf32a7	Последний богатырь: Корень зла	Могучее древнее зло подступает к чудесному Белогорью, где живут герои русского фольклора. Сын Ильи Муромца, современный москвич Иван должен раскрыть свою богатырскую силу, чтобы спасти мир старых добрых сказок. Красочное, зрелищное и веселое фэнтези для всей семьи – продолжение нашумевшего блокбастера 2017 года «Последний Богатырь». Зрителей ждет еще больше колоритных сказочных персонажей, лихих приключений, волшебства и эпических битв добра со злом.\r\n\r\n<p> Несмотря на свои былые заслуги, Иван по-прежнему чувствует себя лишним в этой сказке. В фольклорном Белогорье ему не хватает благ цивилизации и не хватает удали, чтобы сравниться с местными богатырями. На его возлюбленную Василису уже заглядывается опасный соперник Финист – Ясный сокол. Проблемы Вани только обостряются перед лицом невиданной угрозы – пробуждения древней темной силы, ищущей мести. Ее слугам, хитроумным колдуньям, необходимо заполучить легендарный Меч-кладенец. Чтобы узнать истоки и слабости приближающегося зла, Ваня и компания отправляются в большое волшебное путешествие на поиски Кощея Бессмертного. А для победы в решающей битве Иван должен доказать, что он действительно наследник великого Ильи Муромца. </p>\r\n\r\nПогрузитесь в мир большой яркой сказки: предлагаем всей семьей посмотреть онлайн фильм «Последний богатырь: Корень зла».	26f2f911-f5e0-4bfa-86f6-df380dcbc62a	\\img\\content\\films\\200813761.jpg	https://www.youtube.com/embed/cyucTMMbAPQ	2021	t
347db982-4f04-4146-8c56-5567c99ecbd1	Джанго освобожденный	Спагетти-вестерн от короля веселых и кровавых боевиков, блистательного Квентина Тарантино. История беглого раба по имени Джанго получила сразу пять номинаций на «Оскар», столько же – на приз Британской киноакадемии и успела завоевать два «Золотых глобуса». Ну а  некоторые критики заблаговременно внесли «Джанго освобожденный» в список лучших фильмов года. В главных ролях – Джейми Фокс, Кристоф Вальц и Леонардо ДиКаприо. Для последнего работа с Тарантино стала своеобразным дебютом – он впервые за все время своей карьеры сыграл отъявленного злодея. Говорят, ДиКаприо долго не мог смириться с тем, что его  герой – расист. Посмотреть онлайн на звезду «Титаника» в непривычном образе можно в нашем интернет-кинотеатре.  \r\nДействие разворачивается накануне Гражданской войны в США, в 1859 году. Бывший дантист, а ныне охотник за головами Кинг Шульц освобождает раба Джанго. Делает он это отнюдь не по доброте душевной –  ему нужен напарник, который мог бы отыскать банду братьев Бриттл. Поскольку Джанго работал на плантации, где обитали Бриттл, он наверняка может указать на их точное местонахождение. В качестве вознаграждения Шульц обещает рабу полную свободу и спасение его жены Брумгильды, которая была отдана в чужой дом. Так начинается их сотрудничество и охота на самых опасных преступников. К чему все это приведет, можно смотреть онлайн в вестерне «Джанго освобожденный». \r\n\r\nИнтересный факт: во время одной из сцен Леонардо ДиКаприо так сильно стукнул кулаком по столу, что от удара разбился бокал,а осколки стекла вонзились в ладонь. Несмотря на боль, ДиКаприо продолжил монолог. В дальнейшем рану пришлось зашить.	6af421d3-3eed-47f9-b27c-c1052652a81c	\\img\\content\\films\\1112118409.jpg	https://www.youtube.com/embed/4McenUEna3E	2012	t
