b676f760-8557-45c0-990a-1c5279adb923	Легенда	Том Харди, Тэрон Эджертон, Эмили Браунинг и Дэвид Тьюлис в криминальном триллере Брайана Хелгеленда «Легенда».\r\n\r\nОснованный на книге Джона Пирсона «Искусство жестокости: взлет и падение близнецов Крей» фильм расскажет историю братьев-близнецов Крей, Реджинальда и Рональда, - самых знаменитых и опасных британских преступников 1950-1960-хх годов.\r\nМы проследим весь путь братьев - от их становления, через многочисленные ограбления, поджоги и убийства, вознесшие их банду на вершины криминального Олимпа, до ареста и пожизненного тюремного заключения в конце 60-хх.\r\nОни стремительно врываются в криминальный мир, и уже скоро даже крупные боссы вынуждены считаться с ними. В то же время состояние одного из них, Ронни, стремительно меняется: он быстро сходит с ума. Его брату, Реджи, придется непросто, ведь теперь он должен возглавлять крупную банду и держать Ронни под контролем, не дать ему слететь с катушек.\r\n\r\nЧтобы проследить весь путь знаменитых братьев Крей, смотрите онлайн «Легенда».	5902be6c-77ee-4c1e-ae0f-5920c99b12c8	\\img\\content\\films\\1575896325.jpg	https://www.youtube.com/embed/k7izcLjrArc	2015	t
24f7d7f2-4788-4771-af0d-4582973d138b	Основатель	История основателя сети McDonald's Рэя Крока, прошедшего путь от коммивояжера, торгующего миксерами, до одного из самых успешных бизнесменов в мире, главы целой империи ресторанов быстрого питания. Майкл Китон исполняет роль начинающей «акулы бизнеса» в биографическом фильме об американской мечте, силе духа и фастфуде «Основатель» режиссера Джона Ли Хэнкока («Невидимая сторона»).\r\n\r\n<p>Рэю уже за пятьдесят, и всю свою жизнь он перебивался с одной работы на другую, пока однажды ему не улыбнулась удача. Он знакомится с братьями МакДональдами, Маком и Диком, которые открыли успешный семейный ресторанчик в Калифорнии. Всё в этом заведении подчинено единственной цели — максимально быстрому обслуживанию клиента. Загоревшись необычной идеей, Рэй решает преобразовать перспективную забегаловку в масштабную корпорацию.\r\nПроявляя незаурядные предпринимательские способности и настойчивость, он продвигает свой проект, которому суждено уже в ближайшем будущем превратиться в гигантскую сеть ресторанов быстрого питания и принести своему создателю несчетные миллионы.</p>\r\n\r\nДля того чтобы проследить удивительный путь становления и взлета создателя империи McDonald's, предлагаем посмотреть онлайн биографический фильм «Основатель».	6af421d3-3eed-47f9-b27c-c1052652a81c	\\img\\content\\films\\129153105.jpg	https://www.youtube.com/embed/wDDttPDi8d0	2016	f
