aa659e3f-833f-403c-b437-ea91ecddea6e	Летчик	Во время воздушного боя 1941 года советский лётчик Николай Комлев терпит крушение. Чудом выжив, он приземляется в промозглой безлюдной глуши. Между героем и надеждой на спасение лежат многие километры пути, полного опасностей, боли и подвигов мужества.\r\n<p>Декабрь 1941 года. Николай Комелев – советский лётчик, который отправляется в боевой вылет, чтобы остановить колонну немецких танков, идущую на Москву. Самолёт Комлева сбивает вражеский истребитель, но пилоту чудом удаётся посадить судно посреди глухого зимнего леса. Несмотря на то, что герою повезло выжить, его испытания только начинаются. Теперь лётчик должен добраться до своих сослуживцев через холодный, незнакомый лес, несмотря на голод и постоянную опасность: дикие земли кишат волками, фашистские отряды патрулируют окрестности, а Николай тяжело ранен, и его силы постепенно уходят… </p>\r\n<p>Удастся ли отважному Комелеву преодолеть все суровые преграды и спастись? Рекомендуем поклонникам впечатляющих военных драм посмотреть фильм «Лётчик», вдохновлённый реальным подвигом советского героя Алексея Маресьева и голливудским хитом «Выживший» с Леонардо ДиКаприо.</p>	26f2f911-f5e0-4bfa-86f6-df380dcbc62a	\\img\\content\\films\\1162936925.jpg	https://www.youtube.com/embed/rMotjUufoXw	2021	f
