c328130b-bb8e-473c-b7e4-cdbb2a8f59f0	Мидуэй	История важнейшего морского сражения на Тихом океане времён Второй мировой войны. Через несколько месяцев после трагедии в Пёрл-Харбор американский флот одержал героическую победу над японцами, кардинально поменяв расстановку сил в регионе. \r\n<p>7 декабря 1941 года японские силы нанесли разрушительный удар по Пёрл-Харбор, морской базе США на Гавайях. Полгода спустя, 4 июня 1942 года, японские военные вновь пытаются атаковать американские судна в Тихом океане. В ходе трёхдневной битвы в районе атолла Мидуэй храбрые американские военные совершают почти невозможное: одерживают выстраданную победу, которая навсегда изменит это противостояние.</p> \r\n<p>Главные герои фильма Роланда Эммериха – храбрые американские солдаты, которые благодаря своей решительности смогли переломить ход истории. События битвы показаны глазами дерзкого и безбашенного пилота Дика Беста, который управляет самолётом так, будто бы он не намерен остаться в живых, его более осторожных коллег Джеймса Мюррэя и Юджина Линдси, а также любящей супруги Энн.</p> \r\n<p>Всех любителей зрелищных военных фильмов приглашаем посмотреть драму «Мидуэй», основанную на реальных событиях, в нашем онлайн-кинотеатре.</p>	6af421d3-3eed-47f9-b27c-c1052652a81c	\\img\\content\\films\\1258407840.jpg	https://www.youtube.com/embed/tCr7r72njcg	2019	t
