008351ca-2b00-402d-97f4-6fcad9096ad4	Предчувствие	Американский драматический триллер «Предчувствие» – это необычная трагическая история, главную роль в которой сыграла Сандра Баллок. Этот фильм, снятый всего за 45 дней, не является ремейком японской картины, которая носит то же название. \r\nУ каждого из нас в жизни хотя бы раз было предчувствие и, к сожалению, не всегда хорошее. Порой каким-то мистическим, необъяснимым образом ты понимаешь, что сегодняшний день не предвещает тебе ничего доброго. Домохозяйка Линда потеряла всякую надежду и веру в свое счастье. Она с каждым днем все острее чувствует отдаление своего мужа. Он стал совсем чужим для нее. И вот однажды с ней происходит невероятная оказия: она начинает просыпаться в дни недели, которые не идут друг за другом, как обычно, а движутся в хаотичном порядке. Проснувшись в один из таких дней, она узнает от шерифа города ужасную новость – ее мужа больше нет, он погиб в автокатастрофе. Угнетенная горем Линда не находит себе места. Но проснувшись на следующий день, она встречает своего мужа целым и невредимым. Что происходит с Линдой, можно узнать, посмотрев «Предчувствие» онлайн.	6af421d3-3eed-47f9-b27c-c1052652a81c	\\img\\content\\films\\634452464.jpg	https://www.youtube.com/embed/8T0YQvaN1FA	2007	t
