ad0f4c98-b982-4e5c-b117-8264efb6fe4c	Она – океан	Вдохновляющий документальный фильм об удивительных женщинах, которые захотели посвятить свою жизнь океану и пошли наперекор обстоятельствам и самой судьбе, чтобы добиться своей смелой мечты. \r\n<p>Участницы документальной ленты Инны Блохиной – девять невероятно сильных, упорных и целеустремлённых женщин разных возрастов и из разных стран. Всех их объединяет одно: они захотели связать свою жизнь с океаном и стать его частью. Каждая из этих вдохновляющих героинь рассказывает о своём жизненном пути. Чинта Хэнсел – 12-летняя девочка из Индонезии, мечтающая победить в мировом чемпионате по сёрфингу. Легенды этого вида спорта – Коко Хо и Кеала Кеннели, которые делятся со зрителями историями своих успехов и поражений. Оушен Рамзи – известная заклинательница акул, которая, кажется, ничего не боится. Анна Бадер и Роза Молина занимаются фридайвингом – Анна является чемпионкой мира,  – а морской биолог Сильвия Эрл посвятила свою жизнь изучению и защите мирового океана. </p>\r\n<p>Приглашаем поклонников захватывающих документальных лент о по-настоящему храбрых женщинах смотреть онлайн фильм «Она – океан». </p>	6af421d3-3eed-47f9-b27c-c1052652a81c	\\img\\content\\films\\307293096.jpg	https://www.youtube.com/embed/YEvIePUfyU0	2020	f
