66b37544-44a9-444e-ab0f-e34fd5ab4419	Горький привкус любви, или Список фрау Шиндлер	Неизвестная история Эмили Шиндлер – жены немецкого промышленника Оскара Шиндлера, спасшего во время Второй Мировой около 1200 евреев. Роль Эмили в этом подвиге почти не освещается, хотя знаменитый «список Шиндлера» был и ее списком. Своей любовью, милосердием и личным мужеством она внесла неоценимый вклад в спасение множества жизней.\r\n\r\n<p> Во время Холокоста чета Шиндлеров помогала евреям избежать расправы, оформляя их на работу на свои предприятия. Эта история легла в основу оскароносного байопика Стивена Спилберга, вот только Эмили в итоге оказалась в тени. Создатели документальной картины меняют фокус, представляя портрет храброй и любящей женщины с драматичной судьбой. Фильм рассказывает об ее непростых отношениях с мужем, о самоотверженной помощи евреям, о бедности, забвении и любви вопреки всему. В съемках приняли участие биограф Эрика Розенберг, автор нашумевшего романа «Ковчег Шиндлера» Томас Кенилли, историки, журналисты и свидетели событий. Для того чтобы узнать о жизни этой выдающейся женщины, получившей почетное звание «Праведник народов мира», предлагаем посмотреть онлайн фильм «Горький привкус любви, или Список фрау Шиндлер». </p>	26f2f911-f5e0-4bfa-86f6-df380dcbc62a	\\img\\content\\films\\1800815100.jpg	https://www.youtube.com/embed/yy5FB-cRDjQ	2021	t
4bbe8e16-a419-42e0-a2e8-84b7d76d9469	12 лет рабства	«12 лет рабства» - драма режиссера Стива МакКуина («Стыд», «Голод»), основанная на реальной истории незаконно плененного афроамериканца середины XIX века. Три статуэтки «Оскар», среди которых престижнейшая за «Лучший фильм» и еще 78 различных кинопремий. Главные роли в одном из лучших фильмов 2014 года исполнили: трижды номинант на «Золотой глобус» Чиветель  Эджиофор, Брэд Питт, Бенедикт Камбербэтч, а также верный соратник режиссера актер Майкл Фассбендер. \r\n\r\nСоломон Нортап — гражданин США. Вольнорожденный афроамериканец, образованный, уважаемый музыкант, фермер, собственник, волею случая попадает в руки работорговцев из южных штатов. Нортапу приходится пройти через все унижения и испытания рабства, сменить не одного хозяина и обрести законную свободу лишь после двенадцати лет тяжелого труда, оскорблений и издевательств. Свой печальный опыт Соломон Нортап изложил в мемуарах под названием «Двенадцать лет рабства», которые и легли в основу сценария фильма.   \r\n\r\nВнушительное количество наград и положительных отзывов – достойный повод посмотреть фильм «Двенадцать лет рабства» онлайн.	6af421d3-3eed-47f9-b27c-c1052652a81c	\\img\\content\\films\\13266745.jpg	https://www.youtube.com/embed/gp1e7eTQ9wk	2013	t
8a691da5-bad3-463a-87c9-9daf42e11363	Малыш на драйве	Энсел Элгорт («Виноваты звезды») и Лили Джеймс («Война и мир») в криминальном боевике Эдгара Райта («Типа крутые легавые»).\r\n\r\nПарень по прозвищу Малыш обожает скорость и музыку, которая заглушает ему шум в ушах, оставшийся после аварии. Больше всего на свете он мечтает умчаться в закат, но его мечте не суждено сбыться до тех пор, пока его босс Док, криминальный авторитет, не отпустит Малыша. А отпускать он не собирается, ведь этот парень – самый талантливый водила на свете. Не успевает начаться припев его любимой песни, как тачка с грабителями и кучей денег скрывается от полицейских.\r\n\r\nКогда Малыш встречает официантку Дебору, у которой голос точь-в-точь такой, как у его погибшей мамы, он понимает, что с грабежами ему больше не по пути. Но криминальный мир не расстанется с Малышом так просто и будет мстить до последнего.\r\n\r\nНеподдельный драйв, взрывной саундтрек, искрометные шутки – у «Малыша на драйве» есть все, чтобы понравиться каждому. Смотреть фильм Эдгара Райта онлайн можно на нашем сайте.	6af421d3-3eed-47f9-b27c-c1052652a81c	\\img\\content\\films\\1119330521.jpg	https://www.youtube.com/embed/HGGdKX9ByTE	2017	t
9480faf6-e294-4aef-ac75-99e41cf69fdc	Молодость	Майкл Кейн, Харви Кейтель, Рейчел Вайс и Пол Дано в драме Паоло Соррентино «Молодость».\r\nДва старинных друга Фред и Мик проводят лето в элегантном отеле у подножья Альп. Фред когда-то был известным композитором и дирижером, но теперь окончательно отошел от дел. Майк – знаменитый кинорежиссер. Сейчас он пытается закончить сценарий фильма, который должен подвести итог всей его карьере.\r\nСтарость стала для героев временем созерцания, когда у них появилась возможность спокойно понаблюдать за окружающими, переосмыслить свое творчество, задуматься о вопросах бытия. Они видят метания своих взрослых детей, запутавшихся в собственной жизни. Своей неуемной энергией и жизнелюбием Мик вдохновляет молодых сценаристов и голливудского актера, который тоже является постояльцем отеля, на новые свершения. В отличие от друга Фред пребывает в апатии, он не планирует возвращаться к своей профессии. Но сама английская королева хочет вновь увидеть его за дирижерским пультом.\r\nДля того чтобы узнать, как дальше будут развиваться события и что из этого получится, предлагаем смотреть онлайн фильм «Молодость».	ab4d48aa-81f7-4705-99b4-c5f6dbc08a84	\\img\\content\\films\\461499294.jpg	https://www.youtube.com/embed/_3U9RJLc058	2015	f
